import React from "react";
import "../styles/Header.css";

// By importing the Header.css file, it is added to the DOM whenever this component loads
var divStyle = {
  background: "red",
}

function Header() {
  return (
    <header className="header" style={divStyle} >
      <h1>Welcome</h1>
    </header>
  );
}

export default Header;
